import React from 'react';
import { Card } from 'antd';
import 'antd/dist/antd.css';
const { Meta } = Card;

function StoryCard({}){

    return (
        /*<div className="card">
            <h5 className="title">1</h5>
            <span className="rating">2</span>
            <span className="author">3</span>
            <span className="date">4</span>
        </div>*/
        <Card
            style={{
                width: 300,
                marginTop: 16,
            }}
            loading={false}
        >
            <Meta
                title="Card title"
                rating="This is the description"
                author="author"
                date="0000000"
            />
        </Card>
    );
}

export default StoryCard;
